import React from 'react';
import 'antd/dist/antd.css';
import {Menu, Icon, Layout} from 'antd';
import { Link } from 'react-router-dom';


class Menus extends React.Component {
  handleClick = e => {
    console.log('click ', e);
  };


  render(){
      return(
          <Menu
              mode="inline"
              defaultSelectedKeys={['1']}
              style={{ height: '100%' }}
              onClick={this.handleClick}
              >

              <Menu.Item
                  key="1"
                  style={{height:50,fontSize:15}}
                  title={<Link to="/Problem"><Icon type="question-circle" />
                      常见问题</Link>}>
              </Menu.Item>

              <Menu.Item
                  key="2"
                  style={{height:50,fontSize:15}}
                  title={<Link to="/Damage"><Icon type="tool" />
                      受损状况</Link>}>
              </Menu.Item>

              <Menu.Item
                  key="3"
                  style={{height:50,fontSize:15}}
                  title={<Link to="/Apply"><Icon type="snippets" />
                      申请理赔</Link>}>
              </Menu.Item>

              <Menu.Item key="4" style={{height:50,fontSize:15}}>
              <Link to="/Progress"><Icon type="hourglass" />
              理赔进度</Link>
              </Menu.Item>

              <Menu.Item key="5" style={{height:50,fontSize:15}}>
              <Link to="/History"><Icon type="history" />
              历史理赔</Link>
              </Menu.Item>

          </Menu>

      )
  }

}

export default Menus;
